import React from 'react'

function Columns() {
    const items = []
    return (
        <React.Fragment>
            {
                items.map(item => (
                    <ReactFragment key={item.id}>
                        <h1>Title</h1>
                        <p>{item.title}</p>
                    </ReactFragment>
                ))
            }
            <td>Name</td>
            <td>TootieBoy</td>
        </React.Fragment>
    )
}

export default Columns
